// examples/threejs-docs-demo-src.js
async function main() {
  console.log("[Three.js] Starting docs demo...");
  const renderer = new WebGPURenderer({
    canvas,
    antialias: false
  });
  await renderer.init();
  console.log("[Three.js] WebGPU initialized");
  const width = canvas.width || 1280;
  const height = canvas.height || 720;
  renderer.setSize(width, height, false);
  renderer.setPixelRatio(1);
  const scene = new Scene();
  scene.background = new Color(1710638);
  const camera = new PerspectiveCamera(75, width / height, 0.1, 1e3);
  camera.position.z = 4;
  const geometry = new BoxGeometry(1.5, 1.5, 1.5);
  const material = new MeshStandardMaterial({
    color: 65416,
    metalness: 0.4,
    roughness: 0.3
  });
  const cube = new Mesh(geometry, material);
  cube.position.y = -0.2;
  scene.add(cube);
  const ambientLight = new AmbientLight(16777215, 0.6);
  scene.add(ambientLight);
  const directionalLight = new DirectionalLight(16777215, 1.2);
  directionalLight.position.set(5, 5, 5);
  scene.add(directionalLight);
  function createTextPlane(text, fontSize = 64, color2 = "#ffffff", canvasWidth = 1024) {
    const textCanvas = document.createElement("canvas");
    textCanvas.width = canvasWidth;
    textCanvas.height = 128;
    const ctx = textCanvas.getContext("2d");
    ctx.clearRect(0, 0, textCanvas.width, textCanvas.height);
    ctx.font = `bold ${fontSize}px Arial, sans-serif`;
    ctx.textAlign = "center";
    ctx.textBaseline = "middle";
    ctx.shadowColor = "#000000";
    ctx.shadowBlur = 8;
    ctx.shadowOffsetX = 3;
    ctx.shadowOffsetY = 3;
    ctx.strokeStyle = "#000000";
    ctx.lineWidth = 5;
    ctx.strokeText(text, textCanvas.width / 2, textCanvas.height / 2);
    ctx.shadowBlur = 0;
    ctx.shadowOffsetX = 0;
    ctx.shadowOffsetY = 0;
    ctx.fillStyle = color2;
    ctx.fillText(text, textCanvas.width / 2, textCanvas.height / 2);
    const texture2 = new CanvasTexture(textCanvas);
    texture2.needsUpdate = true;
    const aspectRatio = canvasWidth / 128;
    const planeGeometry = new PlaneGeometry(aspectRatio * 0.8, 0.8);
    const planeMaterial = new MeshBasicMaterial({
      map: texture2,
      transparent: true,
      side: DoubleSide
    });
    return new Mesh(planeGeometry, planeMaterial);
  }
  const titleText = createTextPlane("Three.js works natively", 56, "#ffffff", 800);
  titleText.position.set(0, 1.8, 0);
  scene.add(titleText);
  const subtitleText = createTextPlane("with MystralNative", 48, "#00ff88", 600);
  subtitleText.position.set(0, -2, 0);
  scene.add(subtitleText);
  console.log("[Three.js] Scene created with text planes");
  let frameCount = 0;
  function animate() {
    frameCount++;
    cube.rotation.x += 0.01;
    cube.rotation.y += 0.015;
    renderer.render(scene, camera);
    if (frameCount % 60 === 0) {
      console.log(`[Three.js] Frame ${frameCount}`);
    }
    requestAnimationFrame(animate);
  }
  animate();
}
main().catch((e) => {
  console.error("[Three.js] Error:", e.message);
  console.error("[Three.js] Stack:", e.stack);
});
